text:
@Taj_Ali1 @SamTarry Nothing patronising at all, as Khayer well knows.

Sam is a brilliant MP who represents his constituents well (thanks Sam!).

Khayer, on the other hand, deliberately misleads and lies as easily as he breathes. Just as he lacks in integrity, he also lacks in decency. Shameless.

Our students also loved that your favourite novel is Roll of Thunder, Hear My Cry @angiecthomas as it's a very popular text in our English curriculum!

Here's to empowering our young people to be brave, to use their voices and to make positive change!

@Schoolbookclubs
